import styled from 'styled-components';

const View: React.FC = () => {
    return (
        <LETTER>
            <ToAccount> ~에게 보낸편지 </ToAccount>
        </LETTER>
    )
}

export default View;

const LETTER = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: flex-start;
    align-items: center;
    width: 69%;
    height: 740px;
    min-height: 740px;
    max-height: 740px;
    margin-top: 10px;
    border-radius: 10px;
    overflow: auto;
    background-color: ${({ theme }) => theme.colors.white20};
`;

const ToAccount = styled.div`
    width: 100%;
    height: 50px;
    line-height: 50px;
    font-size: 28px;
    text-align: center;
    color: ${({ theme }) => theme.colors.white};
`;
